import React from 'react';
import "./font awesome/all.min.css"
import MyCarousel from './Components/MyCarousel';
import img1 from "./images/103710.jpg"
import img2 from "./images/2225_854x480 - Copie.jpg"
import img3 from "./images/402866.jpg"
import img4 from "./images/497284.jpg"

const lesImages = [
    img1, img2, img3, img4
]

const App = () => {

    return(
        <div className="App">">
          <h1>React Carousel</h1>
          <MyCarousel images={lesImages} />
      </div>
    )
};

export default App;
